Message:
Frontend: fixed many glitches

- Removed spurious log messages from the apache's error log;
- Fixed some bugs:
* the application id was not correctly read by the page that shows the logs of the application manager – only the log of the first application was being shown);
* load statistics were not read correctly by the MySQL service page;
- Fixed many errors that were not affecting the correctness but showed up as warnings in the apache's error log;
- Fixed the logout function: logout should now always succeed and every time a request fails because of the user not being logged it, it will be redirected to the login page instead of shown an error;
- Renamed the volumes functions of the XtreemFS service to differentiate them from the ones that manage regular storage volumes (createXFSVolume instead of createVolume etc.);
- Disabled the sending email function when a new user registers in ConPaaS;
- Improved the appearance of the user registration page and added a “back” button;
- Improved the status messages (“application is starting up...”) and made them all look the same;
- Added some small images used by jQuery widgets that were missing and producing some errors.
